import React from "react";
import { withScriptjs, withGoogleMap, GoogleMap } from "react-google-maps";
import Bidmarker from "../atoms/";

const Bidmap = withScriptjs(withGoogleMap((props) =>{


  const markers = props.markers.map( (marker, idx) => <Bidmarker
                    key={idx}
                    doctor={Bidmarker}
                    location={{lat: actualCenter.lat, lng: actualCenter.lng}}
                  />);
  let actualCenter= props.actualCenter;

  return (
      <GoogleMap
        defaultZoom={14}
        center={ { lat:  actualCenter.lat, lng: actualCenter.lng } }
        >
        {markers}
      </GoogleMap>
    );
  }
))

export default Bidmap;
